  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `app_id` varchar(64) NOT NULL DEFAULT '' COMMENT '应用ID',
  `rule_name` varchar(255) DEFAULT '' COMMENT '规则实例名称',
